import React from 'react';
import './CreateSubscriber.css'

const Decommission = () => {
    return (
        <div className='contentpage'>
            <div className="tc bg-light-white dib br3 ma2 bw2 ba b--light-gray shcenter">
                <main className="pa3  black-80">
                    <fieldset id="sign_up" className="ba b--transparent ph0 mh0">
                        <p className="f3 fw6 ph0 mh0">Decommission</p>
                        <div className="mt3">
                            <label className="db fw6 lh-copy pl3 f6" htmlFor="subscriber-name">Subscriber Name</label>
                            <input className="pa2 input-reset ba br3-l bg-transparent w-90" type="text" name="subscriber-name" id="subscriber-name" />
                        </div>

                    </fieldset>
                    <div className="pa3">
                        <input className="b ph3 input-reset ba b--black br3-l bg-transparent grow pointer f5 dib w-20"
                            type="submit"
                            value="Create" />
                    </div>
                </main>
            </div>
        </div>
    );
};
export default Decommission;
